import { CHECK_USER, LOG_OUT } from "./typeDefinitions";

export const signOut = (id) => {
    return {
        type: LOG_OUT,
        id
    };
}

export const authenticateUser = (username) => {
    return {
        type: CHECK_USER,
        username
    };
}
